border-right: 1px solid #dcdcdc;padding: 8px 12px;border-top: 1px solid #dcdcdc;">k</td><td style="border-right: 1px solid #dcdcdc;padding: 8px 12px;border-top: 1px solid #dcdcdc;">j</td><td style="border-right: 1px solid #dcdcdc;padding: 8px 12px;border-top: 1px solid #dcdcdc;">i</td><td style="border-right: 1px solid #dcdcdc;padding: 8px 12px;border-top: 1px solid #dcdcdc;">h</td><td style="border-right: 1px solid #dcdcdc;padding: 8px 12px;border-top: 1px solid #dcdcdc;">g</td><td style="border-right: 1px solid #dcdcdc;padding: 8px 12px;border-top: 1px solid #dcdcdc;">f</td><td style="border-right: 1px solid #dcdcdc;padding: 8px 12px;border-top: 1px solid #dcdcdc;">e</td><td style="border-right: 1px solid #dcdcdc;padding: 8px 12px;border-top: 1px solid #dcdcdc;">d</td><td style="border-right: 1px solid #dcdcdc;padding: 8px 12px;border-top: 1px solid #dcdcdc;">c</td><td style="border-right: 1px solid #dcdcdc;padding: 8px 12px;border-top: 1px solid #dcdcdc;">b</td><td style="border-right: 0;padding: 8px 12px;border-top: 1px solid #dcdcdc;">a</td></tr></tbody></table><hr><b>Input</b><br/><br/>The input will be a string in the single line containing spaces and letters (both uppercase and lowercase).<hr><b>Output</b><br/><br/>The output should be a single line containing the secret message. All characters in the output should be in lower case.<br/><hr><b>Explanation</b><br/><br/>For example, if the given input is &quot;python&quot;, &quot;p&quot; should replaced with &quot;k&quot;, similarly &quot;y&quot; with &quot;b&quot;, &quot;t&quot; with &quot;g&quot;, &quot;h&quot; with &quot;s&quot;, &quot;o&quot; with &quot;l&quot;, &quot;n&quot; with &quot;m&quot;. So the output should be &quot;kbgslm&quot;.

Solution Code:def getReverseLetter(letter):
    alphabet = "abcdefghijklmnopqrstuvwxyz"
    alphabetReverse = "zyxwvutsrqponmlkjihgfedcba"
    for i in range(0,len(alphabet)):
        if letter.islower() and letter==alphabet[i]:
            return alphabetReverse[i]
        if letter.isupper() and letter==alphabet[i].upper():
            return alphabetReverse[i].lower()
    return -1

def main():
    inputString = input()
    outputString=""
    for letter in inputString:
        reverseLetter=getReverseLetter(letter)
        if(reverseLetter!=-1):
            outputString+=str(reverseLetter)
        else:
            outputString+=letter
    print(outputString)
main()

Write a program to print if the given number is divisible by any of the lucky numbers 6, 3, 2 in decreasing order of priority(6 is luckier than 3 and 3 is luckier than 2).<br/>Print &quot;Number is divisible by&quot; followed by the luckiest number among the above 3 which can divide the number.<br/>Print &quot;Number is not divisible by 2, 3 or 6&quot; if the number is not divisible by any of them.<hr><b>Input</b><br/><br/>The input will be a single line containing a positive number.<hr><b>Output</b><br/><br/>If the given number is divisible by 6, print &quot;Number is divisible by 6&quot;.<br/>If the given number is divisible by 3, print &quot;Number is divisible by 3&quot;.<br/>If the given number is divisible by 2, print &quot;Number is divisible by 2&quot;.<br/>In all other cases print &quot;Number is not divisible by 2, 3 or 6&quot;.<hr><b>Explanation</b><br/><br/>In the example 126 is divisible by 2, 3 and 6<br/>But 6 takes precedence because 6 is luckiest amongst the three. So the output should be &quot;Number is divisible by 6&quot;

Solution Code:number = int(input())

remainder_2 = number % 2
remainder_3 = number % 3

is_lucky_number = False
if (remainder_2 == 0) and (remainder_3 == 0):
    print("Number is divisible by 6")
    is_lucky_number = True

if (remainder_3 == 0) and (not is_lucky_number):
    print("Number is divisible by 3")
    is_lucky_number = True

if (remainder_2 == 0)  and (not is_lucky_number):
    print("Number is divisible by 2")
    is_lucky_number = True

if not is_lucky_number:
    print("Number is not divisible by 2, 3 or 6")

Given the weekday of the first day of the month, determine the day of the week of the given date in that month.


---

#### Input

The first line is a string `D`.
The second line is an integer `N`.


---

#### Output

The output should be a string.

---


#### Explanation

In the given example, `D = Monday`. As the 1st of the day of the month is a Monday, it means the 7th and 14th of the month will be Sundays (A week has 7 days). So the `16th` day (`N = 16`) of the month will be a Tuesday.

So, the output should be `Tuesday`.


Solution Code:d = input()
N = input()
N = int(N)

if d == "Sunday":
    day = 0
elif d == "Monday":
    day = 1
elif d == "Tuesday":
    day = 2
elif d == "Wednesday":
    day = 3
elif d == "Thursday":
    day = 4
elif d == "Friday":
    day = 5
elif d == "Saturday":
    day = 6

target_day = day+N-1
target_day = target_day%7 

if target_day == 0:
    print("Sunday")
elif target_day == 1:
    print("Monday")
elif target_day == 2:
    print("Tuesday")
elif target_day == 3:
    print("Wednesday")
elif target_day == 4:
    print("Thursday")
elif target_day == 5:
    print("Friday")
elif target_day == 6:
    print("Saturday")

Given two integers (M and N), write a program to print the first perfect square in a given range.<hr><b>Input</b><br/><br/>The first line of input will contain a positive integer (M).<br/>The second line of input will contain a positive integer (N).<hr><b>Output</b><br/><br/>The output should be a single line containing the first perfect square in a given range.<hr><b>Explanation</b><br/><br/>For example, if the given numbers are M is 4 and N is 16, the perfect squares from 4 to 16 are 4(2 * 2), 9(3 * 3), and 16(4 * 4), as the first perfect square is 4. So the output should be 4.

Solution Code:n = int(input())
m = int(input())
list_of_nums= []
for i in range(n,m+1):
    for j in range(1,i):
        if i ** 0.5 == j :
            list_of_nums.append(i)
if len(list_of_nums) == 0:
    print("No Perfect Square")
else:
    print(list_of_nums[0])

Write a program to create a menu-driven calculator that performs basic arithmetic operations (+, -, *, /, and %).<hr><b>Input</b><br/><br/>The input will be a single line containing two integers and operator(+, -, *, /, and %) similar to 3 + 5.<hr><b>Output</b><br/><br/>If the given operator is &quot;+&quot;, print the sum of two numbers.<br/>If the given operator is &quot;-&quot;, print the result of the subtraction of the two numbers.<br/>If the given operator is &quot;*&quot;, print the multiplication of the two numbers.<br/>If the given operator is &quot;/&quot;, print the result of the division of the two numbers.<br/>If the given operator is &quot;%&quot;, print the result of the modulus operation of the two numbers.<hr><b>Explanation</b><br/><br/>For example, if the given operator is &quot;+&quot; and the two numbers are 3 and 5. As it is an addition operator, your code should print the sum of the given two numbers (3 + 5), which is 8.<br/>Similarly, if the given operator is &quot;*&quot; and the two numbers are 2 and 5.<br/>As it is a multiplication operator, your code should print the result of the multiplication of the given two numbers (2 * 5), which is 10.<br/>Similarly, if the given operator is &quot;-&quot; and the two numbers are 10 and 9.<br/>As it is a subtraction operator, your code should print the result of the subtraction of the given two numbers (10 - 9), which is 1.

Solution Code:a, operator, b = input().split()
a, b = int(a), int(b)

if operator == "+":
    result = a + b 
elif operator == "-":
    result = a - b 
elif operator == "*":
    result = a * b 
elif operator == "/":
    result = a / b 
elif operator == "%":
    result = a % b 
print(result)

Given a sentence as input, print all the unique combinations of three words in lexicographical order.<hr><b>Input</b><br/><br/>The input will be a single line containing a sentence.<hr><b>Output</b><br/><br/>The output should be multiple lines, each line containing the unique combination of three words in lexicographical order.<hr><b>Explanation</b><br/><br/>For example, if the given sentence is &quot;apple is a fruit&quot;, the possible unique combination of three are (a, apple, fruit), (a, apple, is), (a, fruit, is), (apple, fruit, is). So the output should be<br/><pre style="font-family: Roboto Mono,Lucida Sans Typewriter,Lucida Console,monaco,Courrier,monospace;font-size: .85em;margin: 1.2em 0;"><code style="font-family: Roboto Mono,Lucida Sans Typewriter,Lucida Console,monaco,Courrier,monospace;font-size: inherit;background-color: rgba(228, 237, 255,.5);border-radius: 0px;padding: 1em;display: block;-webkit-text-size-adjust: none;overflow-x: auto;white-space: pre;">a apple fruit
a apple is
a fruit is
apple fruit is
</code></pre>

Solution Code:def generate_3_combinations(words):
    words = sorted(words)
    items = list(range(len(words)))
    combinations_1 = []
    for item in items:
        combinations_1.append([item])  # Generating one word combinations

    # Generating two words combinations by adding one more word to one word combinations
    combinations_2 = []
    for combination in combinations_1:
        for item in items:
            if item > combination[-1]:
                combinations_2.append(combination + [item])

    combinations_3 = []
    for combination in combinations_2:
        for item in items:
            if item > combination[-1]:
                combinations_3.append(combination + [item])

    word_combinations = []
    for combination in combinations_3:
        word_combination = []
        for index in combination:
            word_combination.append(words[index])
        word_combinations.append(tuple(word_combination))
    return sorted(set(word_combinations))


words = input().split()
all_combinations = generate_3_combinations(words)
for combination in all_combinations:
    print(' '.join(combination))

Write a program that reads all the match outcomes and summarizes the information of all the matches. <br/>Points are given to the teams based on the outcome of the match.<br/>A win earns a team 3 points. A draw earns 1. A loss earns 0. <br/>The following information is expected:<br/>MP: Matches Played<br/>W: Matches Won<br/>D: Matches Drawn (Tied)<br/>L: Matches Lost<br/>P: Points<br/><br/>The team information should be displayed in descending order of points.<hr><b>Input</b><br/><br/>The first line contains a single integer N, denoting the total no. of matches played. <br/>The following N lines contain outcomes of N matches. <br/>Each of those lines has information on the teams (T1, T2) which played and the outcome (O) in format T1;T2;O. <br/>The outcome (O) is one of &#x27;win&#x27;, &#x27;loss&#x27;, &#x27;draw&#x27; and refers to the first team listed. <br/>See Sample Input/Output for better understanding.<br/>The team name may contain spaces.<hr><b>Output</b><br/><br/>The output should contain summarized information of all the matches in a format similar to &#x27;Team: CSK, Matches Played: 4, Won: 2, Lost: 1, Draw: 1, Points: 7&#x27; for each team in a new line.<br/>If there are no teams to print in summary, print "No Output".<hr><b>Constraints</b><br/><br/>Names of teams may contain spaces but will be less than 24 characters<br/>100 &gt;= N &gt;= 0

Solution Code:reverse_outcomes = {'win': 'loss', 'loss': 'win', 'draw': 'draw'}

def update_match_outcome(team_stats, team, outcome):
    outcomes = ['win', 'loss', 'draw']
    if not team_stats.get(team):
        team_stats[team] = {'win': 0, 'loss': 0, 'draw': 0}
    for possible_outcome in outcomes:
        if outcome == possible_outcome:
            team_stats[team][outcome] += 1
        else:
            team_stats[team][outcome] += 0

def get_points(team_stats, team):
    return team_stats[team]['win'] * 3 + team_stats[team]['draw']

def store_game_result(team_stats):
    t1, t2, match_outcome = input().split(';')
    update_match_outcome(team_stats, t1, match_outcome)
    update_match_outcome(team_stats, t2, reverse_outcomes[match_outcome])

def print_points_table(team_points, team_stats):
    team_fmt = 'Team: {}, Matches Played: {}, Won: {}, Lost: {}, Draw: {}, Points: {}'
    for points, team in team_points:
        won, lost, draw = team_stats[team]['win'], team_stats[team]['loss'], team_stats[team]['draw']
        matches_played = won + lost + draw
        output = team_fmt.format(team, matches_played, won, lost, draw, points)
        print(output)

def main():
    n = int(input())
    if n == 0:
        print("No Output")
        return
    team_stats = dict()
    for i in range(n):
        store_game_result(team_stats)
    team_points = []
    for team in team_stats:
        team_points.append((get_points(team_stats, team), team))
    team_points.sort(reverse=True)
    print_points_table(team_points, team_stats)

main()

Write a program to print the sum of non-primes in the given N numbers. The numbers which are not primes are considered as non-primes.<hr><b>Input</b><br/><br/>The first line of input will contain a positive integer (N).<br/>The following N lines will contain an integer in each line.<hr><b>Output</b><br/><br/>The output should be the sum of non-primes in the given numbers.<hr><b>Explanation</b><br/><br/>For example, if the given number is 5, then read the inputs in the next 5 lines and print the sum of non-primes in the given five numbers. If the given input integers in the next five lines are 8, 11, 96, 49, and 25 the output should be 8 + 96 + 49 + 25 is 178.

Solution Code:n = int(input())
sum_of_non_primes = 0
for i in range(1,n+1):
    m = int(input())
    count = 0
    for j in range(2,m):
        if(m%j==0):
            count = count +1 

    if(count>=1):
        sum_of_non_primes = sum_of_non_primes + m 

print(sum_of_non_primes)

Given a string in camel case, write a python program to convert the given string from camel case to snake case.<hr><b>Input</b><br/><br/>The input will be a single line contain a string.<hr><b>Output</b><br/><br/>The output should contain the given word in snake case.<hr><b>Explanation</b><br/><br/>For example, if the given word is &quot;PythonLearning&quot; in camel case, your code should print given word in snake case &quot;python_learning&quot;.

Solution Code:camelcase=input()
result=""
for i in camelcase:
    if i==i.upper():
        result=result+"_"+i.lower()
    else:
        result=result+i
print(result[1:])

Write a program to check the overlapping of one string&#x27;s suffix with the prefix of another string.<hr><b>Input</b><br/><br/>The first line of the input will contain a string A.<br/>The second line of the input will contain a string B.<hr><b>Output</b><br/><br/>The output should contain overlapping word if present else print &quot;No overlapping&quot;.<hr><b>Explanation</b><br/><br/>For example, if the given two strings, A and B, are &quot;ramisgood&quot; &quot;goodforall&quot; <br/>The output should be &quot;good&quot; as good overlaps as a suffix of the first string and prefix of next.

Solution Code:a = str(input())
b = str(input())
answer = ""
len1, len2 = len(a), len(b)
for i in range(len1):
    match = ""
    for j in range(len2):
        if (i + j < len1 and a[i + j] == b[j]):
            match += b[j]
        else:
            if (len(match) > len(answer)):
                answer = match
                match = ""
if answer == "" or answer[0] != b[0]:
    print("No overlapping")
else:
    print(answer)

Write a program to recursively create a list of N Fibonacci terms.<br/>A Fibonacci sequence is the integer sequence of 0, 1, 1, 2, 3, 5, 8...<br/>The first two terms are 0 and 1. All other terms are obtained by adding the preceding two terms.<hr><b>Input</b><br/><br/>The first line of input will contain a positive integer (N).<hr><b>Output</b><br/><br/>The output should be a single line containing a list with N Fibonacci terms.<hr><b>Explanation</b><br/><br/>For example, if the given N is 5, your code should print the list of five Fibonacci terms. So the output should be<br/><pre style="font-family: Roboto Mono,Lucida Sans Typewriter,Lucida Console,monaco,Courrier,monospace;font-size: .85em;margin: 1.2em 0;"><code style="font-family: Roboto Mono,Lucida Sans Typewriter,Lucida Console,monaco,Courrier,monospace;font-size: inherit;background-color: rgba(228, 237, 255,.5);border-radius: 0px;padding: 1em;display: block;-webkit-text-size-adjust: none;overflow-x: auto;white-space: pre;">[0, 1, 1, 2, 3]
</code></pre>

Solution Code:def fibonacci(n):
 if n <= 1:
 return n
 else:
 return fibonacci(n-1)+fibonacci(n-2)


def get_fibonacci_series(n):
 fibonacci_series = []
 for i in range(n):
 term = fibonacci(i)
 fibonacci_series.append(term)
 return fibonacci_series


n = int(input())
result = get_fibonacci_series(n)
print(result)

