Write a program to count Vowels and Consonants in string.<hr><b>Input</b><br/><br/>The input will be a single line containing a string s.<hr><b>Output</b><br/><br/>The first line of output should contain no of Vowels in the given string<br/>The second line of output should  contain no of Consonants in the given string<hr><b>Explanation</b><br/><br/>For example, if the given string is &quot;Good Morning&quot;<br/>Vowels in the string &quot;Good Morning&quot; are &quot;o, i&quot; and their count is 4.<br/>Remaining characters in the string are consonants their count is 7.<br/>The First line of output is 4\nThe second line of output is 7.

Solution Code:a=input()
vowel_list=["A","E","I","O","U","a","i","e","o","u"]

for i in a:
    if i==" ":
        a=a.replace(" ","")

vowel_count=0
constant_count=0
for i in a:
    if i in vowel_list:
        vowel_count+=1 
    else:
        constant_count+=1
