Given two strings, write a program to check if the second string is a subsequence of the first string.<br/>A string can be considered subsequence of other if it can be derived from the original string by ignoring or removing some characters without changing the order of the remaining characters.<br/><hr><b>Input</b><br/><br/>The first line of input will contain a string.<br/>The second line of input will contain a string.<br/><hr><b>Output</b><br/><br/>The output should be a single line containing either &quot;Yes&quot; or &quot;No&quot;.<hr><b>Explanation</b><br/><br/>For example, if the first string is &quot;abcde&quot; and the second string is &quot;ace&quot;, the output should be &quot;Yes&quot;, as the second string is a subsequence of the first string.<br/><br/>Whereas, if the first string is &quot;Google&quot;, and the second string is &quot;lg&quot;, the output should be &quot;No&quot;, as the second string is not obtained by ignoring some characters without changing the order in the first string.

Solution Code:full_string = input()
subsequence = input()
subseq_index = 0
subseq_len = len(subsequence)
for char in full_string:
 if char == subsequence[subseq_index]:
 subseq_index += 1
 if subseq_index == subseq_len:
 break
if subseq_index == subseq_len:
 print("Yes")
else:
 print("No")

Given a word, write a program to convert all the uppercase letters to lowercase letters and vice versa.<hr><b>Input</b><br/><br/>The input will be a single line containing a string.<hr><b>Output</b><br/><br/>The output should be a single line containing the modified word.<hr><b>Explanation</b><br/><br/>For example, if the given word is &quot;Coding&quot;, your code should print the output by swapping the case of all letters (&quot;cODING&quot;).

Solution Code:word = input()

modified_word = ""
for character in word:
 uppercase_char = character.upper()
 if uppercase_char == character:
 modified_word = modified_word + character.lower()
 else:
 modified_word = modified_word + character.upper()

print(modified_word)

Write a program to check whether the given number is a perfect number or not.<br/>A number is considered as a Perfect number if sum of all factors excluding itself is equal to the number.<hr><b>Input</b><br/><br/>The input will be a single line containing a positive integer.<hr><b>Output</b><br/><br/>The output should be a single line containing either &quot;Perfect Number&quot; or &quot;Not a Perfect Number&quot;.<hr><b>Explanation</b><br/><br/>For example, if the given number is 6, the factors of 6 excluding it are 1, 2, and 3. The sum of these factors is 6, which is equal to the given number. So the output should be &quot;Perfect Number&quot;.<br/><br/>Similarly, if the given number is 21, the factors of 21 excluding it are 1, 3, and 7. The sum of these factors is 11, Which is not equal to the given number. So the output should be &quot;Not a Perfect Number&quot;.

Solution Code:number = int(input())

total = 0
for i in range(1, number):
 if (number % i) == 0:
 total = total + i

if total == number:
 print("Perfect Number")
else:
 print("Not a Perfect Number")

Write a program to print a greeting message based on the given time.<hr><b>Input</b><br/><br/>The first line of input will be an integer.<hr><b>Output</b><br/><br/>If the time is greater than or equal to 4 and less than 12, print &quot;Good Morning&quot;.<br/>If the time is greater than or equal to 12 and less than 16, print &quot;Good Afternoon&quot;.<br/>If the time is greater than or equal to 16 and less than 20, print &quot;Good Evening&quot;.<br/>If the time is greater than or equal to 20 or less than 4, print &quot;Good Night&quot;.<hr><b>Explanation</b><br/><br/>For example, if the given time is 9, your code should print &quot;Good Morning&quot;.<br/>For example, if the given time is 14, your code should print &quot;Good Afternoon&quot;.

Solution Code:time = int(input())

is_morning = ((time >= 4) and (time < 12))
is_afternoon = ((time >= 12) and (time < 16))
is_evening = ((time >= 16) and (time < 20))

if is_morning:
 print("Good Morning")
elif is_afternoon:
 print("Good Afternoon")
elif is_evening:
 print("Good Evening")
