Given three sides of the triangle(a, b, c) as input. Write a program to determine whether the triangle is Equilateral, Isosceles or Scalene.<hr><b>Input</b><br/><br/>The first line of input will contain an integer A.<br/>The second line of input will contain an integer B.<br/>The third line of input will contain an integer C.<hr><b>Output</b><br/><br/>If the given sides A, B and C are equal, print &quot;Equilateral&quot;.<br/>In the given sides any of two sides are equal print &quot;Isosceles&quot;.<br/>If the given sides A, B, C are not equal to each other, print &quot;Scalene&quot;.<hr><b>Explanation</b><br/><br/>For example, if the given sides are 4, 4, 4 the output should be &quot;Equilateral&quot;.<br/>Similarly, if the given sides are 3, 2, 3 the output should be &quot;Isosceles&quot;.

Solution Code:A = int(input())
B = int(input())
C = int(input())
if A == B and A == C and B == C:
    print("Equilateral")
elif A == B or B == C or A == C:
    print("Isosceles")
elif A != B and B != C and A != C:    
    print("Scalene")

Given a string of length N, made up of only uppercase characters &#x27;R&#x27; and &#x27;G&#x27;, where &#x27;R&#x27; stands for Red and &#x27;G&#x27; stands for Green. Find out the minimum number of characters you need to change to make the whole string of the same colour.<hr><b>Input</b><br/><br/>The input will be a single line containing a string.<hr><b>Output</b><br/><br/>The output should be single line containing the integer representing the minimum number of characters you need to change to make the whole string of the same colour.<hr><b>Explanation</b><br/><br/>For example, if string is &quot;GGGGGGR&quot; . We need to change only the last character to &#x27;G&#x27; to make the string same-coloured.then output is 1.

Solution Code:word = input()
G = 0
R = 0

for i in range(len(word)):
    if(word[i] == "G"):
        G = (G + 1)
    elif(word[i] == "R"):
        R = (R + 1)
if (R > G):
    print(G)
else:
    print(R)

